import React, { useEffect, useState } from 'react';
import LoadingScreen from '../resources/loadingScreen';


const PointLeaders = (data) => {

    const instance = data.props;

    const first = instance.first;
    const second = instance.second;
    const third = instance.third;

    const [ loaded, setLoaded ] = useState(false); 

    useEffect(()=>{
        console.log(instance);
        console.log(first);
        console.log(first);
        console.log(second);
        console.log(third);
        setLoaded(true);
    }, [])

    if(!loaded) { 
        return (
            <LoadingScreen />
        )
    } else {
        return (
            <div className="point-leaders">

                <div className="point-leader-card">
                    <img src={first.img} alt={first.name} />
                    <h3>{first.name}</h3>
                    <p>{first.pts}pts</p>
                    <p>{first.ast}assts</p>
                </div>

                <div className="point-leader-card">
                    <div className="point-leader-card">
                        <img src={second.img} alt={second.name} />
                        <h3>{second.name}</h3>
                        <p>{second.pts}pts</p>
                        <p>{second.ast}assts</p>
                    </div>
                </div>

                <div className="point-leader-card">
                    <div className="point-leader-card">
                        <img src={third.img} alt={third.name} />
                        <h3>{third.name}</h3>
                        <p>{third.pts}pts</p>
                        <p>{third.ast}assts</p>
                    </div>
                </div>

            </div>
        )

    };
}

export default PointLeaders;
